(11532, 44, 'Los glóbulos blancos o leucocitos: 1. Se originan en la médula roja ósea. 2. viven unos 100 a 120 días. 3. fagocitan y hacen diapédesis. 4. son más numerosos que los hematíes.SON CIERTAS:', 6, 'B'),
(11533, 45, 'Son características de la vagina humana, excepto :', 6, 'B'),
(11534, 46, 'Un rayo de luz se propaga en un medio cuyo índice de refracción es 5/3 y va a incidir sobre la superficie de otro medio con un ángulo límite de 53º. Hallar el índice de refracción del segundo medio. ', 6, 'B'),
(11535, 47, 'Si el bloque se encuentra en reposo, calcular la fuerza de rozamiento estático. (m = 10kg)', 6, 'B'),
(11536, 48, 'Un condensador de 1uF se carga con potencial de 3000V. ¿Qué cantidad de calor producirá la chispa de descarga?', 6, 'B'),
(11537, 49, 'De una fuente de calor de 327ºC se transmite 250 kcal a una máquina que opera en el ciclo de Carnot. La máquina cede calor a un sumidero cuya temperatura es 27ºC. Calcular el trabajo que efectúa la máquina', 6, 'B'),
(11538, 50, 'Calcular cuál debe ser el ángulo de inclinación al disparar un proyectil para que alcance una altura de 16,4 pies. Si su velocidad inicial es 65,6 pies / seg. (g=32,8 pies / seg2)', 6, 'B'),
