(11540, 52, 'En el campo eléctrico uniforme cuya intensidad es 4N/C. Hallar la diferencia de potencial entre A y B (vB - vA)', 6, 'B'),
(11541, 53, '¿Cuál será la potencia disipada en un acumulador de 6v, cuya resistencia interna es 0,02 al cortocircuitarse?', 6, 'B'),
(11542, 54, 'En la figura, hallar AD', 6, 'B'),
(11543, 55, 'En un trapecio ABCD BC // AD, BC = 8m y AD= 16m. Si P y Q son los puntos medios de ACY BD respectivamente, entonces la longitud del segmento que une los puntos medios de BP y CQ, es:', 6, 'B'),
(11544, 56, 'Se tiene un triángulo rectángulo isósceles ABC, recto en B. Se construye una circunferencia con diámetro AB y por B se traza una  paralela a la hipotenusa AC que interfecta la circunferencia en E. Hallar la tangente del ángulo CEB', 6, 'B'),
(11545, 57, 'Hallar los números racionales “a” y “b” de la ecuación: 2x3 + bx2 + ax + 7 sabiendo que admite por raíz a. ', 6, 'B'),
(11546, 58, 'Al dividir [ecuaciion]', 6, 'B'),
(11547, 59, 'Calcular la suma de (a + b), si los números a, a + 2b, 2a+b; forman una progresión aritmética y los números (b + 1)2 , (ab + 5), (a + 1)2 ; forman una progresión geométrica.', 6, 'B'),
