(11549, 61, '¿Cuántos números naturales, no mayores de 1512 son primos con 1512?', 6, 'B'),
(11550, 62, 'Dada la reacción A(g) B(g) + C(g)Cuando el sistema está en equilibrio se encontraron las siguientes concentraciones: [A] =0,2 ; [B] =0,3 y [C] = 0,3 Calcular la nueva concentración de equilibrio de A. Si se aumenta el volumen al doble.', 6, 'B'),
