(11557, 69, 'Se tiene 3,5g de N2 a 32ºF y 760mmHg ¿Qué peso de propano (C3H8), en las mismas condiciones de temperatura y presión se requiere para que ocupe el mismo volumen? (N = 14)', 6, 'B'),
